const MapPropstoDispatch=(dispatch)=>{
    return{
        updateMsg:(msg)=>dispatch(setMsg(msg))
    }
}

 const containUserCall=connect(null,MapPropstoDispatch)(RegisterUser);

 export default containUserCall;
